import React from 'react';
import { BrowserRouter, Routes, Route, } from 'react-router-dom';

function App() {
    return (
      <BrowserRouter>
        <ThemeProvider>
          <GlobalStyle />
          <Suspense fallback={<div>...loading</div>}>
            <Switch>
              <Route exact path="/" component={Main}/>
              <Route exact path="/sub" component={Sub}/>
            </Switch>
          </Suspense>
        </ThemeProvider>
      </BrowserRouter>
    );
  }
  export default App;
